import Content from './Content'
import image from './../../img/b.jpg'

import Slider from './Slider';

export default class Client_Home extends Component {
    render() {
        return (
            <div style={{
                background: `url(${image})`,
              }}>
                <Header/>
                <Slider/>
                {/* <AdminHome/> */}
                <Content/>

                 <Footer/>

            </div>
        )
    }
}
